    a2 = 2/(h2 * (h1 + h2));
    a1 = -2/(h1 * h2);
    a0 = 2/(h1 * (h1 + h2));
    ddpdx = a2 * Y2 + a1 * Y1 + a0 * Y0;

function dpdx = leftdY(h1, h2, Y0, Y1, Y2)
    a2 = -h1 / (h2 * (h1 + h2));
    a1 = (h1 + h2) / (h1 * h2);
    a0 = -(2*h1 + h2) / (h1 * (h1 + h2));
    dpdx = a2 * Y2 + a1 * Y1 + a0 * Y0;

